import LibrarySong from './librarySong';

const Library = ({
        songs,
        isPlaying, 
        setSongs,
        setCurrentSong,
        audioRef
    }) => {
    return (
        <div className = {
            `library ${libraryStatus ? opened-library : '' }`
        } >
            <div className="songList">
                <h2 className="librarySongTitle">Library</h2>
                {songs.map(song =>
                    <LibrarySong
                     setCurrentSong = {setCurrentSong}
                    song = {song}
                    setSongs={setSongs}
                    audioRef={audioRef}
                    isPlaying={isPlaying}
                    id={song.id}
                    key={song.id}
                    songs={
                        songs
                    }
                    />
                )}
            </div>

        </div>
    )
}
export default Library
